import styled from "styled-components";
import Card from "semantic-ui-react";

const Root = styled.div`
  width: 100vw;
  height: 100vh;
  display: flex;
  background-color: papayawhip;
`;

export function HomePage() {
  return (
    <Root>
      Hello This is Home Page
      <Card>
        <Card.Content>
          <Card.Header>Joey Kwok</Card.Header>
        </Card.Content>
      </Card>
    </Root>
  );
}
